  {code: "1", name: "Rates are based on normal working hours 09:00 to 17:00 hours Monday to Saturday (excluding Public Holidays & lunch hour).  Waiting time and overtime work instructed shall be charged additional HK$200.00/man/hour (Except welding test).", local_name: "\r\n費率基於週一至週六的正常工作時間09:00至17:00（不包括公共假期和午餐時間）。 指示的等待時間和加班工作應加收HK $ 200.00 /人/小時（焊接測試除外）。"},
  {code: "2", name: "Rates include 1 original of test report.", local_name: "價格包括檢測報告原件1份。\t"},
