  {code: "4", name: "Certified true copy or Amendment of test report due to incorrect information provided by customer will be levied at HK$30.00/sheet. The minimum charge is HK$300.00.\r\n", local_name: "如客戶提供的資料有誤，請出示經核證的真實副本或修訂測試報告，每張收費30港元。 最低收費為港幣300.00元。"},
  {code: "5", name: "This quotation is valid for 30 days.", local_name: "此報價有效期為30天。"},
