  {code: "7", name: "If written acceptance of quotation is made after commencement of the works, the prices will be fixed for a six month period from the date of quotation.", local_name: "應當支付以下費用之一：如果在工程開始後書面接受報價，則價格將自報價之日起六個月內確定。"},
  {code: "8", name: "Terms of payment : Bill should be settled within 30 days upon the invoice date..", local_name: "付款方式：帳單應在發票日期後的30天內結清。"},
  {code: "9", name: "If written acceptance of quotation is made after commencement of the works, the prices will be fixed for a six month period from the date of quotation.", local_name: "如果在工程開始後以書面形式接受報價，則價格將自報價之日起六個月內確定。"},
  {code: "11", name: "Third party insurance and workmen's compensation should be provided by customer.", local_name: "客戶應提供第三方保險和工人賠償。"},
  {code: "12", name: "Welding test reports will be issued in either HOKLAS or CNAS format, unless otherwise specified.", local_name: "除非另有規定，否則焊接測試報告將以HOKLAS或CNAS格式發布。"},
  {code: "10", name: "Water, electricity, scaffolding, working platform, gondola & safety facilities should be provided by customer.", local_name: "客戶應提供水，電，腳手架，工作平台，吊船和安全設施。"},
