  {code: "14", name: "Preliminary reports will be issued in 7 working days. Formal test reports will be issued in 10 working days.", local_name: "初步報告將在7個工作日內發布。"},
  {code: "15", name: "All our test reports & relevant data may be inspected by officers of Government authorities during their surveillance visits to us or our sub-contractor.", local_name: "政府當局的官員在對我們或我們的分包商進行監督訪問時，可能會檢查我們的所有測試報告和相關數據。"},
  {code: "16", name: "All the information obtained or created during the performance of laboratory activities will be kept confidential, except they are required to be released by law.", local_name: "在進行實驗室活動時獲得或創建的所有信息將被保密，除非法律要求將其發布。"},
  {code: "17", name: "Provision of statement of conformity is subject to additional charge except for calibration tests and tests on rebars.", local_name: "除了校準測試和鋼筋測試外，提供合格聲明還需要另外付費。"},
