  {code: "19", name: "Accommodation outside Hong Kong, if so required for the performance of test, should be provided by customer.", local_name: "如果需要在香港以外的地方進行測試，則應由客戶提供。"},
  {code: "20", name: "The rates in this quotation will be adjusted 12 months after this quotation is accepted. An annual increment of 5% will be required to carter for fluctuation.", local_name: "本報價的費率將在接受此報價後12個月進行調整。 波動每年需要增加5％。"},
  {code: "21", name: "Accommodation outside Hong Kong region should be provided by customer.", local_name: "香港地區以外的住宿應由客戶提供。"},
