  {code: "35", name: "Cancellation of test scheduled to be performed within 24 hours will be charged for a cancellation fee of HK$300", local_name: "取消預定於24小時內進行的測試，將收取港幣300元的取消費。"},
  {code: "36", name: "Orders could not be changed or cancelled after confirmed", local_name: "訂單確認後無法更改或取消"},
