  {code: "38", name: "Sampling arrangement requires 3 working days advance notice. Express sampling arrangement within 1-2 working days will cost an additional charge of HK$200.00 per sample.", local_name: "抽樣安排需要提前3個工作日通知。 在1-2個工作日內進行快速抽樣安排，每個樣本將收取200港元的額外費用。"},
